import "./App.css";
import React from "react";
import {
  Navigation,
  Top,
  About,
  Experience,
  Projects,
  Contact,
} from "./components";
function App() {
  return (
    <>
      <Navigation />
      <Top />
      <About />
      <Experience />
      <Projects />
      <Contact />
    </>
  );
}

export default App;
